  "handle": "harringtons-small-animal-optimum-rabbit-food-2-kgs",
  "description": "<p>Harringtons Optimum Rabbit Food is a complementary feed for rabbits, containing a single all-in-one nugget to help avoid selective feeding. It contains a wide variety of high quality ingredients and is fortified with vitamins to help support your rabbits immune system. We add yeast extracts and high fibre ingredients to help promote healthy digestion. We recommend providing unlimited access to fresh hay or fresh grass and water as an essential part of your rabbits diet, which is needed to aid the digestive process. Harringtons provides the conventional benefits associated with premium pet foods.</p>\n<p>Made in the UK</p>\n<p><strong>Benefits:</strong></p>\n<ul>\n<li><span>Natural Antioxidants</span></li>\n<li><span>Green Tea, Rich In Health Promoting Natural Antioxidants</span></li>\n<li><span>Nothing Nasty, No Artificial Colours Or Flavours</span></li>\n<li><span>Quality Sources of Fibre, Which Are Essential For A Healthy Digestion</span></li>\n<li><span>With Added Apple and Grape For Extra Tastiness</span></li>\n<li>A Nutritionally Balanced All In - One Nugget To Help Prevent Selective Feeding</li>\n<li>With Calcium and Phosphorous for Healthy Teeth and Bones</li>\n</ul>\n<p><strong>Ingredients:</strong></p>\n<div class=\"ex-product-tabs__column\">\n<div class=\"ex-product-tabs__column\">\n<h3 class=\"h5 sans\">COMPOSITION</h3>\n<ul>\n<li>Wheatfeed</li>\n<li>Oatfeed</li>\n<li>Lucerne</li>\n<li>Sunflower Ext.</li>\n<li>Maize</li>\n<li>Grass</li>\n<li>Apple (4%)</li>\n<li>Grape (4%)</li>\n<li>Carob Meal</li>\n<li>Vegetable Oil</li>\n<li>Linseed</li>\n<li>Minerals</li>\n<li>Yeast (0.1%)</li>\n</ul>\n</div>\n<div class=\"ex-product-tabs__column\">\n<h3 class=\"h5 sans\">ADDITIVES (PER KG)</h3>\n<ul>\n<li>Vitamin A 17,000 iu</li>\n<li>Vitamin D3 1,700 iu</li>\n<li>Vitamin E (alpha tocopherol acetate) 95 mg</li>\n<li>Iron Sulphate Monohydrate 33mg</li>\n<li>Calcium Iodate Anhydrous 2.5 mg</li>\n<li>Cupric Sulphate Pentahydrate 25 mg</li>\n<li>Manganous Oxide 48 mg</li>\n<li>Zinc Oxide 34 mg</li>\n<li>Zinc Chelate 167 mg</li>\n<li>Antioxidant</li>\n</ul>\n</div>\n<div class=\"ex-product-tabs__column\">\n<h3 class=\"h5 sans\">ANALYTICAL CONSTITUENTS</h3>\n<ul>\n<li>Protein 13.5%</li>\n<li>Fat Content 4.5%</li>\n<li>Crude Fibre 17%</li>\n<li>Crude Ash 7%</li>\n<li>Calcium 0.7%</li>\n<li>Phosphorous 0.5%</li>\n</ul>\n</div>\n<div class=\"ex-feeding-guide-tiles\">\n<div class=\"ex-feeding-guide-tile\">\n<div class=\"ex-feeding-guide-tile__weight-range\"><strong>Rabbit - Young -100-130g Per day</strong></div>\n<div class=\"ex-feeding-guide-tile__animal-icon\"><img src=\"https://cdn.shopify.com/s/files/1/0054/2569/2758/t/58/assets/rabbit-young.png?v=14674680807150636550\" alt=\"rabbit-young\" width=\"197\" height=\"156\"></div>\n<div class=\"ex-feeding-guide-tile__food-weight-amount\"><br></div>\n<div class=\"ex-feeding-guide-tile__food-weight-amount\"><strong></strong></div>\n</div>\n<div class=\"ex-feeding-guide-tile\">\n<div class=\"ex-feeding-guide-tile__weight-range\"><strong>Rabbit - Adult 130-150g Per day</strong></div>\n<div class=\"ex-feeding-guide-tile__animal-icon\"><img src=\"https://cdn.shopify.com/s/files/1/0054/2569/2758/t/58/assets/rabbit-doe.png?v=14426015671720277741\" alt=\"rabbit-doe\" width=\"244\" height=\"193\"></div>\n<div class=\"ex-feeding-guide-tile__food-weight-amount\"><br></div>\n<div class=\"ex-feeding-guide-tile__food-weight-amount\"><strong></strong></div>\n</div>\n<div class=\"ex-feeding-guide-tile\">\n<div class=\"ex-feeding-guide-tile__weight-range\"><strong>Rabbit - Doe &amp; Litter -350-400g Per day</strong></div>\n<div class=\"ex-feeding-guide-tile__animal-icon\"><img src=\"https://cdn.shopify.com/s/files/1/0054/2569/2758/t/58/assets/rabbit-doe-and-litter.png?v=1698087501310080098\" alt=\"rabbit-doe-and-litter\" width=\"225\" height=\"178\"></div>\n<div class=\"ex-feeding-guide-tile__food-weight-amount\"><br></div>\n<div class=\"ex-feeding-guide-tile__food-weight-amount\"><strong></strong></div>\n</div>\n</div>\n<div class=\"ex-feeding-guide__supporting-text\">\n<p>Rabbits need access to fresh hay and water at all times. Hay is essential to help them maintain a healthy digestion.</p>\n<p>They enjoy variety and appreciate the addition of fresh food in their diet several times each week. Washed apples, broccoli and cabbage are ideal.</p>\n<p>It is unkind to overfeed your pet, so adjust the amount you feed to keep them at their ideal weight.</p>\n<p>Chewing small twigs from trees such as apple and hazel helps to keep their teeth strong and healthy.</p>\n<p>When changing food, do so gradually over a 7 to 10 day period.</p>\n</div>\n</div>\n<div class=\"ex-product-tabs__column\">\n<div class=\"ex-feeding-guide__supporting-text\"></div>\n</div>",
