  "handle": "oxbow-western-timothy-dry-hay-grass-for-small-animals",
  "description": "<p><span>Oxbow’s all-natural Western Timothy Hay is a nutritious, sweet-smelling grass that will stimulate the appetite of your rabbit, guinea pig, chinchilla, or other small pet.  Western Timothy is the #1 vet-recommended hay for small herbivores.</span></p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>Harvested fresh from Oxbow’s family of farms</li>\n<li>Hand-sorted and hand-packed with care</li>\n<li>Grown specifically for small pets</li>\n<li>High in fiber for digestive &amp; dental health</li>\n<li>Premium quality grass</li>\n</ul>\n<p><strong>Feeding Instructions: </strong><span data-mce-fragment=\"1\">Place large handfuls of grass hay in your pet’s habitat daily.  Mix different grass hays together to enrich your pet’s diet.  Try all tastes and textures to discover your pet’s favorites.</span><br><b><br></b><strong>Ingredients: </strong><span data-mce-fragment=\"1\">Crude Protein (min) 7.00% Crude Fat (min) 1.50%</span><span data-mce-fragment=\"1\"> Crude Fiber (max) 32.00% Moisture (max) 15.00%</span>.<br></p>\n<p><strong>Precautions: </strong>Store hay in a cool dry place that is free of any insects and pests. Ensure that you gently push air out of the bag before closing after use.</p>\n<p><strong>HUFT Tip: </strong>Keeping your rabbit hutch clean is of prime importance to their health. Dirty hutches can cause respiratory illnesses, sore feet, urine scalding and dirty bottoms.</p>",
